import React from "react";

function Home() {
    return (
        <div style={{maxWidth: '1200px', margin: '0 auto', padding: '1rem'}}>
            <h1 style={{fontSize: '1.875rem', fontWeight: 'bold', textDecoration: 'underline', marginBottom: '1rem', color: 'blue'}}>Home Page</h1>
            <p style={{fontSize: '1.125rem', color: 'red', backgroundColor: 'yellow', padding: '0.5rem', borderRadius: '0.375rem', boxShadow: '0 1px 3px 0 rgba(0, 0, 0, 0.1)', border: '2px solid red'}}>
                Welcome to our website! This paragraph uses inline styles.
            </p>
            <button style={{marginTop: '1rem', backgroundColor: 'green', color: 'white', fontWeight: '600', padding: '0.5rem 1rem', borderRadius: '0.5rem'}}>
                Click me!
            </button>
        </div>
    )
}

export default Home;
